import NavigationBar from "./navigationBar";
import Body from "./Body";
import { Route, Switch } from "react-router-dom";
function All() {
  return (
    <Route path="/accueil" exact>
      <Switch>
      <NavigationBar />
      <Body />
      </Switch>
    </Route>
  );
}
export default All;
